
CREATE DATABASE EmployeeManagement;
USE EmployeeManagement;

-- Table: PERSONAL_INFO
CREATE TABLE PERSONAL_INFO (
    EmployeeNumber INT PRIMARY KEY,
    Age INT,
    EducationField VARCHAR(50),
    Education INT,
    RelationshipSatisfaction INT
);

-- Table: EMPLOYEE
CREATE TABLE EMPLOYEE (
    EmployeeNumber INT PRIMARY KEY,
    Over18 CHAR(1),
    Gender VARCHAR(10),
    MaritalStatus VARCHAR(20),
    DistanceFromHome INT,
    StandardHours INT,
    WorkLifeBalance INT,
    FOREIGN KEY (EmployeeNumber) REFERENCES PERSONAL_INFO(EmployeeNumber)
);

-- Table: EMPLOYMENT_HISTORY
CREATE TABLE EMPLOYMENT_HISTORY (
    HistoryID INT PRIMARY KEY AUTO_INCREMENT,
    EmployeeNumber INT,
    NumCompaniesWorked INT,
    TotalWorkingYears INT,
    PreviousCompany VARCHAR(100),
    StartDate DATE,
    EndDate DATE,
    FOREIGN KEY (EmployeeNumber) REFERENCES EMPLOYEE(EmployeeNumber)
);

-- Table: JOB_DETAILS
CREATE TABLE JOB_DETAILS (
    EmployeeNumber INT PRIMARY KEY,
    JobRole VARCHAR(50),
    JobLevel INT,
    JobInvolvement INT,
    JobSatisfaction INT,
    EnvironmentSatisfaction INT,
    BusinessTravel VARCHAR(50),
    OverTime BOOLEAN,
    YearsInCurrentRole INT,
    YearsSinceLastPromotion INT,
    YearsAtCompany INT,
    YearsWithCurrManager INT,
    FOREIGN KEY (EmployeeNumber) REFERENCES EMPLOYEE(EmployeeNumber)
);

-- Table: DEPARTMENT
CREATE TABLE DEPARTMENT (
    DepartmentID INT PRIMARY KEY AUTO_INCREMENT,
    Department VARCHAR(50),
    EmployeeCount INT,
    Location VARCHAR(100),
    Budget VARCHAR(100)
);

-- Table: PERFORMANCE
CREATE TABLE PERFORMANCE (
    PerformanceID INT PRIMARY KEY AUTO_INCREMENT,
    EmployeeNumber INT,
    PerformanceRating INT,
    PercentSalaryHike INT,
    ReviewDate DATE,
    Feedback VARCHAR(255),
    Goals VARCHAR(255),
    FOREIGN KEY (EmployeeNumber) REFERENCES EMPLOYEE(EmployeeNumber)
);

-- Table: COMPENSATION
CREATE TABLE COMPENSATION (
    EmployeeNumber INT PRIMARY KEY,
    DailyRate FLOAT,
    HourlyRate FLOAT,
    MonthlyRate FLOAT,
    MonthlyIncome FLOAT,
    StockOptionLevel INT,
    Benefits VARCHAR(100),
    Bonus INT,
    FOREIGN KEY (EmployeeNumber) REFERENCES EMPLOYEE(EmployeeNumber)
);

-- Table: MANAGER
CREATE TABLE MANAGER (
    ManagerID INT PRIMARY KEY AUTO_INCREMENT,
    EmployeeNumber INT UNIQUE,
    ManagementLevel VARCHAR(50),
    TeamSize INT,
    ResponsibilityArea VARCHAR(100),
    FOREIGN KEY (EmployeeNumber) REFERENCES EMPLOYEE(EmployeeNumber)
);

-- Table: PROJECT
CREATE TABLE PROJECT (
    ProjectID INT PRIMARY KEY AUTO_INCREMENT,
    DepartmentID INT,
    ProjectName VARCHAR(100),
    StartDate DATE,
    EndDate DATE,
    Status VARCHAR(50),
    Priority VARCHAR(50),
    FOREIGN KEY (DepartmentID) REFERENCES DEPARTMENT(DepartmentID)
);

-- Table: TRAINING
CREATE TABLE TRAINING (
    TrainingID INT PRIMARY KEY AUTO_INCREMENT,
    EmployeeNumber INT,
    TrainingName VARCHAR(100),
    TrainingTimesLastYear INT,
    CompletionDate DATE,
    Status VARCHAR(50),
    Certification VARCHAR(100),
    FOREIGN KEY (EmployeeNumber) REFERENCES EMPLOYEE(EmployeeNumber)
);



